                <h3>Please verify your email and input your score to be on the leaderboard!</h3>
                <form className="block p-50">
                    <label>Email</label>
                    <input type="email" className="bg-transparent" required></input>
                    <br></br>
                    <br></br>
                    <label>Score</label>
                    <input type="text" className="bg-transparent" required></input>
                </form>
            </div>
        </>
    );
}

